--Tworzenie bazy danych

USE MASTER;
GO

DROP DATABASE IF EXISTS ProjectWSB;
GO

CREATE DATABASE ProjectWSB;
GO

USE ProjectWSB;
GO

DROP SCHEMA IF EXISTS EnergyProduction;
GO

CREATE SCHEMA EnergyProduction AUTHORIZATION dbo;
GO

--Tworzenie tabel

--Tabela EnergyProduction

DROP TABLE IF EXISTS EnergyProduction.Production;
GO

CREATE TABLE EnergyProduction.Production
		(ProductionID int IDENTITY(1,1) NOT NULL CONSTRAINT ProductionID Primary Key,
		ProductionDate Date NOT NULL,
		ProductionHour int NOT NULL,
		WindProduction float NOT NULL,
		SolarProduction float NOT NULL,
		);


--Tabela SunriseSunset

DROP TABLE IF EXISTS EnergyProduction.SunriseSunset;
GO

CREATE TABLE EnergyProduction.SunriseSunset
		(SunriseSunsetDate Date NOT NULL Primary Key,
		Sunrise datetime NOT NULL,
		Noon datetime NOT NULL,
		Sunset datetime NOT NULL,
		);

--Tabela Weather

DROP TABLE IF EXISTS EnergyProduction.Weather;
GO

CREATE TABLE EnergyProduction.Weather
		(WeatherID int IDENTITY(1,1) NOT NULL CONSTRAINT WeatherID Primary Key,
		StationCode int NOT NULL,
		StationName nvarchar(50) NOT NULL,
		WeatherYear int NOT NULL,
		WeatherMonth int NOT NULL,
		WeatherDay int NOT NULL,
		AverageCloudiness float NOT NULL,
		AverageWindSpeed float NOT NULL,
		AverageTemperature float NOT NULL,
		);

--Tabela WeatherStations

DROP TABLE IF EXISTS EnergyProduction.WeatherStations;
GO

CREATE TABLE EnergyProduction.WeatherStations
		(WeatherStationID int IDENTITY(1,1) NOT NULL CONSTRAINT WeatherStationID Primary Key,
		StationCode int NOT NULL,
		StationName nvarchar(50) NOT NULL,
		Latitude nvarchar(50) NOT NULL,
		Longitude nvarchar(50) NOT NULL,
		);


